#Requires -Version 2

$Empaneling = ""
$Tupperware = ""
$Emancipate = ""
$Paternally = ""
$Metastasis = ""
$Conferring = ""
$Difficulty = ""
$Mussorgsky = ""
$Blarneying = ""
$Flourished = ""
$Placarding = ""
$Overexpose = ""
$Doughtiest = ""
$Docudramas = ""
$Overstated = ""
$Teetotaler = ""
$Artificial = ""
$Futurities = ""
$Sportscast = ""
$Believable = ""
$Coagulates = ""
$Hybridized = ""
$Disregards = ""
$Funereally = ""

$Modules = @($Empaneling,$Tupperware,$Emancipate,$Paternally,$Metastasis,$Conferring,$Difficulty,$Mussorgsky,$Blarneying,$Flourished,$Placarding,$Overexpose,$Doughtiest,$Docudramas,$Overstated,$Teetotaler,$Artificial,$Futurities,$Sportscast,$Believable,$Coagulates,$Hybridized,$Disregards,$Funereally)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
